def test_send_message_to_llm():
    with requests_mock.Mocker() as mock:
        mock.post("https://openrouter.ai/api/v1/chat/completions", json={"status": "ok"}, status_code=200)

        response = send_message_to_llm("System prompt", "User prompt")
        assert response.ok
        assert response.status_code == 200


def test_send_to_webui():
    with requests_mock.Mocker() as mock:
        mock.get("https://a57.foxnews.com/static.foxnews.com/foxnews.com/content/uploads/2023/12/343/193/hillary-and-bill-clinton.jpg?tl=1&ve=1", content=image_bytes)

        mock.get("http://localhost:8000/api/v1/tags/ai", status_code=404)
        mock.get("http://localhost:8000/api/v1/tags/python", status_code=404)

        mock.post("http://localhost:8000/api/v1/tags/", json={"id": 1}, status_code=201)
        mock.post("http://localhost:8000/api/v1/tags/", json={"id": 2}, status_code=201)

        mock.post("http://localhost:8000/api/v1/articles/", json={"status": "ok"}, status_code=201)

        response = send_to_webui(article_data)
        assert response.status_code == 201
        assert mock.called
        assert mock.call_count == 6